package com.collections.progrms;

import java.util.Stack;

public class StackExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		Stack<Integer> s=new Stack<>();
		s.push(10);
		s.push(20);
		s.pop();
		
		s.push(30);
		s.push(40);
		
		System.out.println(s);
		
		
		System.out.println(s);
		

	}

}
